import './Card.css';

const Matches = ({ match, index }) => {
  const nextMatch = match.homeTeam.toString();
  console.log(nextMatch);
  return (
    <section>
      <article className='matches'>
        <div>{nextMatch}</div>
      </article>
    </section>
  )
};

export default Matches;
